  false,\n\t\"url\": null,\n\t\"notes\": \"A primary responsibility of the United
  States Fish and Wildlife Service is to identify, monitor, and protect nationally
  listed endangered and threatened species of plants and animals. When these species
  occur on a National Wildlife Refuge, the Service is responsible and assumes a lead
  role in the welfare of these species. Therefore the Canaan Valley National Wildlife
  Refuge staff will establish a comprehensive monitoring program for the Cheat mountain
  salamander on the Kelly-Elkins Tract.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
